import React, { useEffect, useState } from "react";

function LoginSystem(props) {
	useEffect(() => {});
	return (
		<div>
			<h3>Login</h3>
			<form>
				<button type="submit" value="login">
					login
				</button>
			</form>

			<div
				role="button"
				className="button"
				href="#"
				onClick={props.setFormStatus}
			>
				Cancel
			</div>
		</div>
	);
}

export default LoginSystem;
